import React from 'react';
import { Document, Page } from 'react-pdf';

function Contact() {
  const pdfFile = '/Component/Akshat_Pandey.pdf'; // Replace with the actual path to your PDF file

  return (
    <div>
      <h2>Resume</h2>
      <Document file={pdfFile}>
        <Page pageNumber={1} />
      </Document>
    </div>
  );
}

export default Contact;
